"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:37794380748;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s:0:"";}i:26;a:1:{s:2:"id";s:19:"2391025899594895414";}i:27;a:1:{s:10:"short_code";s:11:"CEuoWMyHNA2";}i:28;a:1:{s:12:"created_time";i:1599252522;}i:29;a:1:{s:7:"caption";s:2075:"It's been a while since I did one of these fancy Friday introduction thingamajigs. So... here we are. In case we haven't met before...Hi. I'm April, the Editing Soprano.‚Å£
As you might guess by my name, I'm an editor and I'm a singer. As you might also guess, if you know anything about wordsmiths or musicians, I'm a little bit of a control freak and perfectionist. Although I'm getting better. That's not to say I won't let you bend a rule, and I might even help you break a few if it means better art! But I have a hard time letting myself do the same thing. Again, I'm getting better at it. For instance this post might have a typo in it (I don't think it does, but I'm not going to go back to check. See? progress!) Not that I'd let a manuscript out of my hands that easily, but this is social media. I'm choosing my battles. :)‚Å£
For someone who loves to sing, I'm very shy about doing it at the drop of a hat, but I think that's true of most introverted singers. If you want to hear me, you'll have to catch me live at church or in concert (although not anytime soon, it seems). Please don't ask me at the dinner table in front of a bunch of people. I'll freeze like a rabbit cornered by a pack of wolves.‚Å£
I also love to write, but I find I'm better at helping others polish their own writing. I still have dreams of putting out a few books, but have little time to devote and I think supporting and encouraging other writers is more important right now. Maybe not forever, but for right now. ‚Å£
‚Å£
and that's me in a nutshell. Please, tell me about you. What are two things you think you're known for, or that you'd say you do. They don't have to be official jobs, but if you love doing them, I'd love to hear about them. :) Happy Friday and have a good weekend!‚Å£
‚Å£
p.s. snapchat has the best filters. the end. ‚Å£
